import React, {Component} from 'react';
import './Pokecard.css';



export default class Pokecard extends Component{
    render(){



        return(
            <div className="card">
                <img src={this.props.imgSrc} />
                <h3>{this.props.name}</h3>
                <p>{this.props.id}</p>
                <p>{this.props.abilities}</p>               
            </div>
        );
    }
}
